    use at Lake Andes NWR for 1960. A short summary of water rights is provided. Existing
    water supplies, as of January 1961, are tabulated for each of the four units providing
    numbers for gauge reading, management level, maximum level, inflow, and outflow.
    A end of each month value for gage readings, for each of the four units, are recorded
    for 1960 and are followed by notes regarding the status of wildlife and habitats
    for 1960. Lastly the water management plan for 1961 is presented.",nt"license_title":
